                                                325
                                            ],
                                            "type": "text",
                                            "content": "7. 任何状况下引起的出卖人回购共有产权住房（包括但不限于按照出卖人与贷款机构签订的贷款合作协议约定，贷款机构要求出卖人回购买受人持有的共有产权份额的），买受人对上述回购行为均予以同意并认可，保证不提出任何异议，并保证配合出卖人、贷款机构办理相关产权份额的转让手续，确保回购的顺利完成。"
                                        }
                                    ]
                                }
                            ],
                            "index": 4
                        },
                        {
