                                                79,
                                                330,
                                                504,
                                                364
                                            ],
                                            "type": "text",
                                            "content": "8.任何状况下引起的出卖人回购共有产权住房，出卖人均按买受人实际出资额退购房款（以下简称回购款项）。"
                                        }
                                    ]
                                }
                            ],
                            "index": 5
                        }
