                                74,
                                370,
                                512,
                                405
                            ],
                            "spans": [
                                {
                                    "bbox": [
                                        74,
                                        370,
                                        512,
                                        405
                                    ],
                                    "type": "text",
                                    "content": "如买受人为全款购房，在出卖人同意买受人的申请且买受人腾退住房并将住房过户至出卖人名下后二十个工作日内，出卖人向买受人支付回购款项。"
                                }
                            ]
                        }
                    ],
                    "index": 7
                },
