                    "angle": 0,
                    "lines": [
                        {
                            "bbox": [
                                73,
                                410,
                                512,
                                524
                            ],
                            "spans": [
                                {
                                    "bbox": [
                                        73,
                                        410,
                                        512,
                                        524
                                    ],
                                    "type": "text",
                                    "content": "如买受人为贷款购房，出卖人支付的回购款项的全部或部分将根据贷款机构的指示直接划付到贷款机构的指定账户，优先用于偿还买受人所欠贷款机构的贷款本息及相关费用（如有）。如有剩余，出卖人应在买受人腾退房屋并将住房过户至出卖人名下后二十个工作日内将剩余回购款项退回给买受人。如果回购款项不足以偿还贷款机构的贷款本息及相关费用（如有），不足部分由买受人自行承担，且买受人应当在偿还完毕贷款机构所有款项后7个工作日内完成房屋腾退并配合出卖人办理房屋过户手续。"
                                }
                            ]
                        }
                    ],
