                                                512,
                                                644
                                            ],
                                            "type": "text",
                                            "content": "11.如买受人逾期偿还贷款，导致贷款机构要求出卖人承担连带保证责任的，出卖人承担连带保证责任后有权解除本合同或要求回购该共有产权房屋。且，如因买受人原因导致本合同解除或出卖人回购该共有产权住房的，则买受人应当承担房屋总价款的【】%的赔偿金，出卖人有权从退回给买受人的回购款项中扣除相应赔偿金，买受人对此无异议。"
