                                    "bbox": [
                                        73,
                                        690,
                                        512,
                                        744
                                    ],
                                    "type": "text",
                                    "content": "买受人签订合同满10年仍未购买完全产权的，应按出卖人持有产权份额所占相应面积向出卖人缴纳房屋租金。租金标准由出卖人按房屋租赁市场价格确定并收缴。出卖人每年调整一次租金标准，并在公开途径公布。"
                                }
                            ]
