                                                187
                                            ],
                                            "type": "text",
                                            "content": "2. 买受人购房时按照大连市房屋专项维修资金管理规定，全额交存专项维修资金。出卖人回购住房的，由出卖人按照买受人交存专项维修资金数额退回相应专项维修资金。"
