                                            "content": "3.因一方当事人不按照法律、法规规定缴纳相关税费导致本合同无法继续履行的，另一方当事人有权要求解除合同，并按照买受人购买的对应比例的房屋产权部分价款的【】%作为违约金支付给守约方。"
