                                    "type": "text",
                                    "content": "4. 买受人购买的该共有产权住房与同期建设的商品住房项目按照《__________》（解释：此处应填写该项目所签物业合同的全称）的约定实行统一的物业管理，并以相同标准按照全部产权比例自行缴纳物业服务费。"
