                                    "bbox": [
                                        82,
                                        331,
                                        520,
                                        387
                                    ],
                                    "type": "text",
                                    "content": "出卖人无偿接受配建该共有产权住房环节产生的税费，由税务部门按照国家现行规定办理税收征免，并出具相关手续。该共有产权住房在出卖人取得产权登记及现房批文后销售，并由已网签备案的买受人与出卖人共同向房屋所在地不动产登记部门申请办理不动产登记。"
                                }
                            ]
                        }
                    ],
                    "index": 7
                },
                {
