                            "spans": [
                                {
                                    "bbox": [
                                        81,
                                        391,
                                        520,
                                        444
                                    ],
                                    "type": "text",
                                    "content": "不动产登记部门向买受人核发权属证书，权属证书应注明产权性质、购房人姓名、购房人产权份额、出卖人名称及出卖人产权份额等。对出卖人只登记不发证，出卖人根据需要获取不动产登记查询证明。"
                                }
                            ]
                        }
                    ],
                    "index": 8
                },
