                                    "bbox": [
                                        81,
                                        451,
                                        520,
                                        505
                                    ],
                                    "type": "text",
                                    "content": "买受人可一次或多次购买增持产权份额。买受人多次购买增持份额的，由出卖人向买受人出具新购份额的购房款发票，不动产登记部门不办理换发产权证业务，待买受人完成购买全部份额时，一次性办理完全产权登记。"
                                }
                            ]
