                                    "content": "在该共有产权住房保修范围和保修期限内发生质量问题，出卖人应当要求该共有产权住房的开发商承担保修义务。因不可抗力或者非出卖人原因、非开发商原因造成的损坏，出卖人或开发商不承担责任，但可协助维修，维修费用由买受人承担。"
