                                            "type": "text",
                                            "content": "1.买受人承诺，购买的该共有产权住房供购买申请户居住使用。在未经出卖人许可的情况下，买受人不得擅自分割产权份额、转让、出租、出借、赠与该共有产权住房或者改变房屋使用性质，并不得设定除该共有产权住房购房贷款担保以外的抵押权。"
                                        }
