                                            "type": "text",
                                            "content": "3. 买受人不得擅自改变该共有产权住房的建筑主体结构、承重结构和用途。除本合同及其附件另有规定者外，买受人在使用期间有权与其他权利人共同享用与该共有产权住房有关联的公共部位和设施，并按占地和公共部位与公用房屋分摊面积承担义务。"
