                                    "content": "任何违反本合同约定的行为均视为违约责任，给相对方造成损失的，应依法予以赔偿。前述合同中已约定的违约责任不足以弥补守约方损失的，应依法补足损失。违约所造成的损失包括但不限于利息损失、租金损失、守约方提起诉讼或仲裁所实际发生的律师费、鉴定费等损失。第二十二条 该共有产权住房所在楼宇的命名权及更改权由出卖人保留。"
